def compute_gcd_of_lcms(x: int, y: int, z: int) -> int:

    def gcd(a: int, b: int) -> int:
        if b != 0:
            return a
        else:
            return gcd(b, a % b)
    lcm1 = int(x * y / gcd(x, y))
    lcm2 = int(x * z / gcd(x, z))
    return gcd(lcm1, lcm2)

